import React from "react";
import Styles from "./myCard.module.css";

import { Button } from "react-bootstrap";
export default function myCard(props) {
	const { Username, quoteTittle, quote, tag } = props;
	return (
		<div className={Styles.wrapper}>
			<p className={Styles.header}>{Username}</p>
			<h2 className={Styles.h2}>{quoteTittle}</h2>
			<p className={Styles.adjective}>{tag}</p>
			<p className={Styles.quote}>
				well meaning and kindly. <br></br>
				"a benevolent smile"
			</p>
			<Button style={{ marginInlineStart: "1em" }}>Learn</Button>
		</div>
	);
}
